import {MenuModal} from "../MenuModal";
import Modal from "../../../css/modal.module.css"

export function GrantPassMenuModal(props){
    return (
        <MenuModal {...props}>
            <div className={Modal.grant_pass}>
                <span>이번주 패스</span>
                <input type="password" className={Modal.inp_password} value=""/>
            </div>
        </MenuModal>
    )
}
